<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>SafeTunes Carousel V2 - Slide 4 (Screenshots)</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
      background: #f0f2f5;
      display: flex;
      justify-content: center;
      align-items: center;
      min-height: 100vh;
      padding: 20px;
    }

    .ad-container {
      width: 1080px;
      height: 1080px;
      background: linear-gradient(180deg, #F8FAFC 0%, #E2E8F0 100%);
      display: flex;
      flex-direction: column;
      justify-content: flex-start;
      align-items: center;
      padding: 50px 60px;
      text-align: center;
      position: relative;
    }

    .headline {
      font-size: 48px;
      font-weight: 900;
      color: #1F2937;
      line-height: 1.2;
      margin-bottom: 35px;
    }

    .screens-container {
      display: flex;
      gap: 30px;
      justify-content: center;
      align-items: flex-start;
    }

    .screen-wrapper {
      display: flex;
      flex-direction: column;
      align-items: center;
    }

    .screen-label {
      background: linear-gradient(135deg, #7C3AED 0%, #EC4899 100%);
      color: white;
      padding: 10px 28px;
      border-radius: 50px;
      font-size: 20px;
      font-weight: 800;
      text-transform: uppercase;
      letter-spacing: 1px;
      margin-bottom: 16px;
    }

    .screen-label.green {
      background: linear-gradient(135deg, #10B981 0%, #059669 100%);
    }

    .phone-frame {
      width: 280px;
      height: 580px;
      background: #1F2937;
      border-radius: 40px;
      padding: 10px;
      box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
    }

    .phone-screen {
      width: 100%;
      height: 100%;
      background: #fff;
      border-radius: 32px;
      overflow: hidden;
    }

    .phone-screen img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      object-position: top;
    }

    .caption {
      font-size: 22px;
      font-weight: 700;
      color: #4B5563;
      margin-top: 20px;
      max-width: 280px;
    }

    .arrow-container {
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 0 10px;
      margin-top: 280px;
    }

    .arrow {
      font-size: 60px;
      color: #7C3AED;
      font-weight: 900;
    }

    .bottom-bar {
      position: absolute;
      bottom: 40px;
      display: flex;
      align-items: center;
      gap: 12px;
      background: white;
      padding: 18px 36px;
      border-radius: 16px;
      box-shadow: 0 4px 24px rgba(0, 0, 0, 0.1);
    }

    .bottom-text {
      font-size: 26px;
      font-weight: 800;
      color: #1F2937;
    }
  </style>
</head>
